import React from 'react';
import styled from 'styled-components';

interface IHeader{
    title:string
}


const HeaderContainer = styled.section`
   background: red
`;

function Header(props:IHeader) {
  return (
    <HeaderContainer>{props.title}</HeaderContainer>
  )
}

export default Header;
